import React from "react";

const Todo = (props) => {
  console.log(props.done);
  return (
    <div>
      <h1>{props.description} </h1>
      <h2>{props.done ? "Erledigt" : "Nicht erledigt"}</h2>
    </div>
  );
};

export default Todo;
